import React from 'react';
import './labelInputEmail.scss';

interface LabelInputProps {
    classNameAdded: string;
    autoComplete: string;
    placeHolder: string;
}

const LabelInput = ({classNameAdded = '', autoComplete = '', placeHolder =''}: LabelInputProps): JSX.Element => {
    return (
        <>
            <label className={`${classNameAdded} labelInput`}>
                <input type="email" pattern=".+@globex\.com" className="labelInput__input" autoComplete={autoComplete} placeholder={placeHolder} />
                <span className="labelInput__placeholder">{placeHolder}</span>
            </label>
        </>
    );
}

export default LabelInput;
